import Select from '@mui/material/Select';
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import Box from '@mui/material/Box';

interface Props{

}
export default function Time(props: Props){
    const Times = [
        undefined,
        15,
        30,
        45,
        60
    ]
    return (
        <>
            <InputLabel id="time">Timer</InputLabel>
            <Select
                labelId="time"
                id="time"
                label="Age"
                className="h-8"
            >
                {Times.map((time: number | undefined)=>{
                    return (
                        time ? 
                        <MenuItem value={time}>{time}</MenuItem>
                         : 
                        <MenuItem defaultChecked={true} value="No Limit">No Limit</MenuItem>
                    )
                })}
            </Select>
            <Box sx={{ minWidth: 120 }}>
                    <InputLabel id="demo-simple-select-label">eifj</InputLabel>
                    <Select
                    labelId="demo-simple-select-label"
                    id="demo-simple-select"
                    value={age}
                    label="Age"
                    onChange={handleChange}
                    >
                    <MenuItem value={10}>Ten</MenuItem>
                    <MenuItem value={20}>Twenty</MenuItem>
                    <MenuItem value={30}>Thirty</MenuItem>
                    </Select>
            </Box>
        </>
    )
}
